# encoding=utf-8
import numpy as np
import pandas as pd
import time
import joblib
from sklearn.model_selection import  train_test_split
from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score, roc_auc_score, roc_curve

from sklearn.ensemble import AdaBoostClassifier

dataset = pd.read_csv('../../csv/train/TIMESTAMP.csv', engine='python')
# 划分训练集，验证集
X_train, X_test, y_train, y_test = train_test_split(dataset.iloc[:, :-1], dataset.iloc[:, -1], test_size=0.2,
                                                    random_state=42)
def acc(y_test,test_predict):

    score = accuracy_score(y_test, test_predict)
    print('Accuracy：%.2f%%' % (score * 100))

    # 精准率
    precision = precision_score(y_test, test_predict)
    print('Precision：%.2f%%' % (precision * 100))

    # 召回率
    recall = recall_score(y_test, test_predict)
    print('Recall：%.2f%%' % (recall * 100))

    # F1值
    f1 = f1_score(y_test, test_predict)
    print('F1：%.2f%%' % (f1 * 100))

    # auc曲线下面积
    auc = roc_auc_score(y_test, test_predict)
    print('AUC：%.2f%%' % (auc * 100))

    # ks值
    fpr, tpr, thresholds = roc_curve(y_test, test_predict)
    ks = max(abs(fpr - tpr))
    print('KS：%.2f%%' % (ks * 100))
def model_save_load(model, x_transform):
    # 模型加载
    clf = joblib.load(model)
    # 数据预测
    y_pred = [round(value) for value in clf.predict(x_transform)]
    y_pred_proba = clf.predict_proba(x_transform)
    print('y_pred：', y_pred)
    print('y_pred_proba：', y_pred_proba)
    return y_pred

def model_fit(X_train,y_train):
    print('Start training...')
    # n_estimators表示要组合的弱分类器个数；
    # algorithm可选{‘SAMME’, ‘SAMME.R’}，默认为‘SAMME.R’，表示使用的是real boosting算法，‘SAMME’表示使用的是discrete boosting算法
    clf = AdaBoostClassifier(n_estimators=900, algorithm='SAMME.R')
    clf.fit(X_train, y_train)
    test_predict = clf.predict(X_test)
    # 模型训练acc,pre,recall
    acc(y_test, test_predict)
    return clf


